import React from 'react'

import {Banner} from './SchoolBanner.styles'



const SchoolBanner = ({school, name, costPerCredit, deliveryMode}) => {
    return(
        <Banner >
            <Logo url={"abc"}/>
            <ProgramName>{"Information Technology"}</ProgramName>
            <DegreeType>{`${"Associates of Science"} | ${"College of Engineering"}`}</DegreeType>
            <CollegeName>{"Sanata Rosa Junior College"}</CollegeName>
        </Banner>
    )
}

export default SchoolBanner
